require "debug"

original_data = DATA.read.chomp
data = original_data.dup
part_two_data = original_data.dup

def tick(string)
  stack = []
  string.each_char do |char|
    if !stack.empty? && (stack.last.ord - char.ord).abs == 32
      stack.pop
    else
      stack.push(char)
    end
  end
  stack.join
end

puts tick(data).length

# part 2
lengths = []
polymers = ('a'..'z').zip('A'..'Z').map(&:join)

polymers.each do |polymer|
  new_string = part_two_data.dup
  letter_lower = polymer[0]
  letter_upper = polymer[1]
  new_string = new_string.gsub(/[#{letter_lower}#{letter_upper}]/, "")

  lengths << tick(new_string).length
end

puts lengths.min
__END__

